import React, { useState, useEffect } from "react";
import {
  Container,
  Button,
  Form,
  FormGroup,
  Label,
  Input,
  FormText,
} from "reactstrap";

const Home = () => {
  const [login, setLogin] = useState("");
  const [password, setPassword] = useState("");
  const onChangeHandler = (event) => {
    if (event.name === "login") {
      setLogin(event.value);
    } else {
      setPassword(event.value);
    }
  };
  useEffect(() => {
    console.log(login);
  }, [login]);
  return (
    <Container>
      <h1>Home</h1>
      <Form>
        <FormGroup>
          <Label for="exampleEmail">Email</Label>
          <Input
            type="login"
            name="login"
            id="login"
            placeholder="JohnDoe"
            value={login}
            onChange={(e) => onChangeHandler(e.currentTarget)}
          />
        </FormGroup>
        <FormGroup>
          <Label for="examplePassword">Password</Label>
          <Input
            type="password"
            name="password"
            id="Password"
            placeholder="aaaaa"
            value={password}
            onChange={(e) => onChangeHandler(e.currentTarget)}
          />
        </FormGroup>
      </Form>
    </Container>
  );
};
export default Home;
